import React,{Component} from 'react';
class Nav extends Component{
    render(){
        return(
            <div className="navigation">
              <div className="logo">
                  logo
              </div>
              <div className="lists">
               <li>Home</li>
               <li>About</li>
              </div>
            </div>
        )
    }

  
  
}

export default nav;
